function Friend({ friend }) {
  return (
    <li>
      <img src={friend.image} alt={friend.name} srcset="" />
      <h3>{friend.name}</h3>

      {friend.balance < 0 && (
        <p className="red">
          You owe {friend.name} {friend.balance}
        </p>
      )}
    </li>
  );
}

export default Friend;
